import { InputAdornment, TextField } from '@material-ui/core';
import React, {Component} from 'react';
import SearchIcon from '@material-ui/icons/Search';

class Test extends Component {
    render () {
        return (



            <TextField
                InputProps = {
                    { startAdornment:(

                        <InputAdornment position='start'>
                            <SearchIcon/>
                        </InputAdornment>
                    )
                }}
            />
        )
    }
}

export default Test;
